// src/LoginButton.js
import React from 'react';

const LoginButton = ({ onAuthenticated }) => {
    const handleLogin = () => {
        window.location.href = 'http://localhost:3001/login';
    };

    return (
        <button onClick={handleLogin}>Log in with Spotify</button>
    );
};

export default LoginButton;
